{
  "body": "{\"blocks\":[{\"key\":\"fc2po\",\"text\":\"Hello friends at Retool!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5uc47\",\"text\":\"We continue to be impressed and delighted by Retool as time goes on and our team continues to integrate it more and more into our workflows. We're looking to lean on it even more, and have thus come to an area where we'd like some guidance on: automatic testing for the JavaScript that.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5fae5\",\"text\":\"We're mainly talking about code that run in the transformers. The approach that seems at first blush to be the best long-term solution is publishing an npm package or other form of JS bundle that we could run tests against in CI.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"jq27\",\"text\":\"Do you have a recommend way of testing the JS that runs in Retools?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}",
  "title": "JavaScript Testing"
}

